import React from 'react'
import "./SASS/style.css";


const TodoItems = (props)=>{
    const {items} = this.props;
    const mimo = items.map(
        res =>{
            return(
                <div key={res.id}>
                    <p>{res.name}</p>
                    <p>{res.job}</p>
                    <p>Country{res.countrey}</p>
                </div>
            )
        }
    )
    return(
        <div>sdasdasd</div>
    )
}

export default TodoItems
